Information
------------------------------

Sex, Lies and Gender
The gender of a newborn child is not always clearly male or female. For parents of gender variant children, the decisions they face have lifelong and sometimes horribly conflicting consequences. National Geographic investigates the science behind gender, how doctors and parents approach gender decisions, and explore traditional and controversial therapies.

